const pokemon = [
  {
    Raichu: {
      quickMoves: {
        Spark: true,
        Thundershock: true,
        "Volt Switch": true
      }
    }
  },
  {
    Pikachu: {
      quickMoves: {
        "Quick Attack": true,
        Present: true,
        Thundershock: true
      }
    }
  }
];

export default pokemon;
